import React from 'react';
import './Overview.css';
import { Link } from 'react-router-dom';

function Overview() {
    return (
        <div>
            <div className="BioSect">
                <div className="BioPic"></div>
                <div className="BioText">
                    Text Text Text Text <br/> <a href="AboutMe">Read More...</a>
                </div>
            </div>
            <div className="ExpSect">
                <div className="ExpPic"></div>
                <div className="ExpText">
                    Text Text Text Text <br/> <a href="Experiences">Read More...</a>
                </div>
            </div>
            <div className="ProjSect">
                <div className="ProjPic"></div>
                <div className="ProjText">
                    Text Text Text Text <br/> <a href="/Projects">Read More...</a>
                </div>
            </div>
        </div>
    );
}

export default Overview;
